DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;  
	START TRANSACTION;
	
		IF NOT EXISTS (
				SELECT ParentChildMappingId
				FROM ParentChildMapping
				WHERE TemplateFileId = p_TemplateFileId
					AND ParentTableName = p_ParentTableName
					AND ParentTableColumn = p_ParentTableColumn
					AND ChildTableName = p_ChildTableName
					AND ChildTableColumn = p_ChildTableColumn
				)
		
		THEN
			INSERT INTO ParentChildMapping (
				TemplateFileId
				,ParentTableName
				,ParentTableColumn
				,ChildTableName
				,ChildTableColumn
				)
			VALUES (
				p_TemplateFileId
				,p_ParentTableName
				,p_ParentTableColumn
				,p_ChildTableName
				,p_ChildTableColumn
				);
		END IF;

	COMMIT;
END ;;
