CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_CreateTemplateCopy`(
	p_TemplateId INT
	,p_CompanyId INT
	,p_CreatedBy INT
    ,p_TeamId INT
	)
BEGIN

 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;
	
		 SELECT @TemplateName := TemplateName
			,@Description := Description
			,@TemplateFileZip := TemplateFileZip
			,@IsActive := IsActive
			,@ExcelZip := ExcelZip
			,@FolderId := FolderId
			,@SubFolderName := SubFolderName
			,@FileNamePart := FileNamePart
			,@ExcelVersion := ExcelVersion
		FROM Template
		WHERE TemplateId = p_TemplateId;  
   
   SELECT @NewTemplateName := CONCAT(@TemplateName,CONCAT('-Copy(', COUNT(TemplateId), ')')) 
		FROM Template
		WHERE TemplateName = @TemplateName OR TemplateName LIKE CONCAT(@TemplateName, '-Copy(%') GROUP BY TemplateName, TemplateId;
        
	INSERT INTO Template (
			CompanyId
			,TemplateName
			,CreatedOn
			,CreatedBy
			,UpdatedOn
            ,UpdatedBy
			,Description
			,TemplateFileZip
			,IsActive
			,ExcelZip
			,FolderId
			,SubFolderName
			,FileNamePart
			,ExcelVersion
            ,TeamId
			)
		VALUES (
			p_CompanyId
			,@NewTemplateName
			,GETDATE()
			,p_CreatedBy
			,GETDATE()
			,p_CreatedBy
			,@Description
			,@TemplateFileZip
			,@IsActive
			,@ExcelZip
			,@FolderId
			,@SubFolderName
			,@FileNamePart
			,@ExcelVersion
            ,p_teamId
			);
   SET @NewTemplateId = LAST_INSERT_ID();
   SET @RID = 0;
   CREATE TEMPORARY TABLE tempTable 
			SELECT (@RID := @RID + 1) AS RowID, TemplateFileId
			,FileName
			,FileDisplayName
			,FilePath
		FROM TemplateFile
		WHERE TemplateId = p_TemplateId;
        
  SET @CurrentRow = 1;

		SELECT @RowsToProcess = COUNT(TemplateId)
		FROM TemplateFile
		WHERE TemplateId = p_TemplateId;

		WHILE @CurrentRow <= @RowsToProcess
		DO
			SELECT @TemplateFileId = TemplateFileId
				,@FilePath = FilePath
			FROM tempTable
			WHERE RowID = @CurrentRow;

			INSERT TemplateFile (
				TemplateId
				,FileName
				,FileDisplayName
				,FilePath
				,IsXFA
				)
			SELECT @NewTemplateId
				,FileName
				,FileDisplayName
				,FilePath
				,IsXFA
			FROM TemplateFile
			WHERE TemplateFileId = @TemplateFileId;

			SET @NewTemplateFileId = LAST_INSERT_ID();

			INSERT TemplateFileFieldMapping (
				TemplateId
				,TemplateFileId
				,PDFFieldName
				,ExcelFieldName
				,IsMapped
				,FilePath
				,SheetName
				,ExcelTableName
				,FieldId
				,ParentFieldId
				,IsDynamic
				,HasChildFields
				,XPath
				)
			SELECT @NewTemplateId
				,@NewTemplateFileId
				,PDFFieldName
				,ExcelFieldName
				,IsMapped
				,FilePath
				,SheetName
				,ExcelTableName
				,FieldId
				,ParentFieldId
				,IsDynamic
				,HasChildFields
				,XPath
			FROM TemplateFileFieldMapping
			WHERE TemplateFileId = @TemplateFileId;

			SET @CurrentRow = @CurrentRow + 1;
		END WHILE;

	COMMIT;
END ;;
DELIMITER ;
