CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_CreateTemplateSet`(
	p_CompanyId INT
    ,p_TeamId INT
	,p_TemplateName nvarchar(100)
	,p_Description nvarchar(500)
	,p_TemplateFileZip longblob
	,p_IsActive bit
	,p_CreatedOn datetime
	,p_CreatedBy int
	,p_ExcelZip longblob	
	,p_TemplateFolderId int
	,p_FolderName nvarchar(150)
	,p_SubFolderName TEXT
	,p_FileNamePart TEXT
	,p_ExcelVersion nvarchar(38)
	,p_IsDemoTemplate bit
	,p_ExcelBytes longblob
	,p_FileExtension nvarchar(5)
	,OUT p_TemplateId INT
    ,p_createdByuser VARCHAR(200)
	)
BEGIN
 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
  
	ROLLBACK;
	RESIGNAL;
  END;      
	START TRANSACTION;

	
		INSERT INTO Template (
			CompanyId                                
			,TemplateName
			,Description
			,TemplateFileZip
			,IsActive
			,CreatedOn
			,CreatedBy
			,UpdatedOn
			,UpdatedBy
			,ExcelZip
			,FolderId
			,SubFolderName
			,FileNamePart
			,ExcelVersion
			,IsDemoTemplate
			,ExcelBytes
			,FileExtension
            ,TeamID
			)
		VALUES (
			p_CompanyId
			,p_TemplateName
			,p_Description
			,p_TemplateFileZip
			,p_IsActive
			,p_CreatedOn
			,p_CreatedBy
			,p_CreatedOn
			,p_CreatedBy
			,p_ExcelZip
			,p_TemplateFolderId
			,p_SubFolderName
			,p_FileNamePart
			,p_ExcelVersion
			,p_IsDemoTemplate
			,p_ExcelBytes
			,p_FileExtension
            ,p_TeamId
			);

		SET p_TemplateId = LAST_INSERT_ID();
        
		INSERT TemplateFile (
			TemplateId
			,FileName
			,FileDisplayName
			,FilePath
			,IsXFA
			,PdfBytes
			)
		SELECT p_TemplateId
			,FileName
			,FileDisplayName
			,FilePath
			,IsXFA
			,PdfBytes 
		FROM udt_templatefileoffice where createByUser = p_createdByuser;

		CREATE TEMPORARY TABLE tempTable  (
			`RowID` INT NOT NULL PRIMARY KEY AUTO_INCREMENT
			,`TemplateFileId` INT
			,`FileName` VARCHAR(200)
			,`FileDisplayName` VARCHAR(200)
			,`FilePath` TEXT
			);

		INSERT INTO tempTable (TemplateFileId,FileName,FileDisplayName,FilePath)
		SELECT TemplateFileId
			,FileName
			,FileDisplayName
			,FilePath
		FROM TemplateFile
		WHERE TemplateId = p_TemplateId;

		SET @CurrentRow := 0;

		SELECT @RowsToProcess := COUNT(TemplateId)
		FROM TemplateFile
		WHERE TemplateId = p_TemplateId;

		WHILE @CurrentRow <= @RowsToProcess
		DO
			SELECT @TemplateFileId := TemplateFileId
				,@FilePath := FilePath
			FROM tempTable
			WHERE RowID = @CurrentRow;

			INSERT TemplateFileFieldMapping (
				TemplateId
				,TemplateFileId
				,PDFFieldName
				,IsMapped
				,FilePath
				,FieldId
				,ParentFieldId
				,IsDynamic
				,HasChildFields
				,XPath
				)
			SELECT p_TemplateId
				,@TemplateFileId
				,PDFFieldName
				,IsMapped
				,FilePath
				,FieldId
				,ParentFieldId
				,IsDynamic
				,HasChildFields
				,XPath
			FROM udt_templatefilefieldmapping
			WHERE FilePath = @FilePath AND createByUser = p_createdByuser;

			SET @CurrentRow = @CurrentRow + 1;
		END WHILE;

    
	COMMIT;
END ;;
DELIMITER ;
