CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_DeleteTemplate`(p_TemplateId int)
BEGIN
DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;  
	START TRANSACTION;	
		DELETE
		FROM TemplateFileFieldMapping
		WHERE TemplateFileId IN (
				SELECT TemplateFileId
				FROM TemplateFile
				WHERE TemplateId = p_TemplateId
				);

		DELETE
		FROM TemplateFile
		WHERE TemplateId IN (
				SELECT TemplateId
				FROM Template
				WHERE TemplateId = p_TemplateId
				);

		DELETE
		FROM Template
		WHERE TemplateId = p_TemplateId;

	COMMIT;
END ;;
