CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_DeleteTemplateFolder`(p_FolderId INT)
BEGIN


 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;
	
	DROP TEMPORARY TABLE IF EXISTS `tmp_tempTable`;
		CREATE  TEMPORARY TABLE IF NOT EXISTS tmp_tempTable (FolderId INT);
		INSERT INTO tmp_tempTable VALUES (p_FolderId);
		INSERT INTO tmp_tempTable
		SELECT FolderId
		FROM TemplateFolder
		WHERE ParentFolderId IN (
				SELECT FolderId
				FROM TemplateFolder
				WHERE FolderId = p_FolderId
					OR ParentFolderId = p_FolderId
				);
 
		DELETE
		FROM TemplateFileFieldMapping
		WHERE TemplateId IN (
				SELECT TemplateId
				FROM Template
				WHERE FolderId IN (
						SELECT FolderId
						FROM tmp_tempTable
						)
				);
 
		DELETE
		FROM TemplateFile
		WHERE TemplateId IN (
				SELECT TemplateId
				FROM Template
				WHERE FolderId IN (
						SELECT FolderId
						FROM tmp_tempTable
						)
				);
 
		DELETE
		FROM Template
		WHERE FolderId IN (
						SELECT FolderId
						FROM tmp_tempTable
						);
		/*DELETE
		FROM Template
		WHERE TemplateId IN (
				SELECT TemplateId
				FROM Template
				WHERE FolderId IN (
						SELECT FolderId
						FROM tmp_tempTable
						)
				);*/
 
		DELETE
		FROM TemplateFolder
		WHERE FolderId IN (
				SELECT FolderId
				FROM tmp_tempTable
				);

	COMMIT;
END ;;
