CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_GetChildTablesByFileId`(p_TemplateFileId int)
BEGIN	

 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;

        DROP TEMPORARY TABLE IF EXISTS tmp_tempTable;
		CREATE TEMPORARY TABLE IF NOT EXISTS tmp_tempTable (RowID INT NOT NULL PRIMARY KEY AUTO_INCREMENT, ExcelTableName VARCHAR(150), IsMapped BIT);
       
		INSERT INTO tmp_tempTable (ExcelTableName, IsMapped)
		SELECT ExcelTableName,0
		FROM TemplateFileFieldMapping
		WHERE TemplateFileId = @TemplateFileId
			AND IsDynamic = 1
			AND ExcelTableName IS NOT NULL;

		SET @CurrentRow := 0;

		SELECT @RowsToProcess := COUNT(TemplateFileMappingid)
		FROM TemplateFileFieldMapping
		WHERE TemplateFileId = p_TemplateFileId
			AND IsDynamic = 1
			AND ExcelTableName IS NOT NULL;

		WHILE @CurrentRow <= @RowsToProcess
		DO
			SELECT @ChildName := ExcelTableName
			FROM tmp_tempTable
			WHERE RowID = @CurrentRow;

			IF EXISTS (
					SELECT ParentChildMappingId
					FROM ParentChildMapping
					WHERE ChildTableName = @ChildName
						AND TemplateFileId = @TemplateFileId
					)
			THEN
				UPDATE tmp_tempTable
				SET IsMapped = 1
				WHERE RowID = @CurrentRow;
			END IF;
            
			SET @CurrentRow := @CurrentRow + 1;
		END WHILE;

		SELECT ExcelTableName, IsMapped FROM tmp_tempTable;
        
	COMMIT;
END ;;
DELIMITER ;
