CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_GetParentTableFields`(p_TemplateId INT)
BEGIN
DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END; 

	START TRANSACTION;	
		
		SELECT ExcelFieldName
		FROM TemplateFileFieldMapping AS t
        INNER JOIN 
        (SELECT ExcelTableName
		FROM TemplateFileFieldMapping AS tf
		WHERE tf.ParentFieldId IS NULL AND tf.TemplateId=p_TemplateId LIMIT 1) AS dt
        ON t.ExcelTableName = dt.ExcelTableName
		WHERE t.TemplateId = p_TemplateId
			AND t.IsMapped = 1;
			
	
	COMMIT;
END ;;
