CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_GetSendDataParam`(p_TemplateId INT)
BEGIN
    
 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;
    
	DROP TEMPORARY TABLE IF EXISTS tmp_TempTable;
	CREATE TEMPORARY TABLE IF NOT EXISTS tmp_TempTable (SheetName VARCHAR(150), ParentTable VARCHAR(150) ,ChildTable VARCHAR(150));

		SELECT @SheetName := SheetName
			,@ParentTable := ExcelTableName
		FROM TemplateFileFieldMapping
		WHERE TemplateId = p_TemplateId
			AND ExcelTableName IS NOT NULL
			AND ParentFieldId IS NULL;

		IF (
				(
					SELECT COUNT(ExcelTableName)
					FROM TemplateFileFieldMapping
					WHERE TemplateId = p_TemplateId
						AND ExcelTableName IS NOT NULL
						AND IsDynamic = 1
						AND IsMapped = 1                       
					) > 0
				)
		THEN
			INSERT INTO tmp_TempTable (ChildTable)
			SELECT ExcelTableName
			FROM TemplateFileFieldMapping
			WHERE TemplateId = p_TemplateId
				AND ExcelTableName IS NOT NULL
				AND IsDynamic = 1
				AND IsMapped = 1;

			UPDATE tmp_TempTable SET SheetName = @SheetName ,ParentTable = @ParentTable;		
		ELSE		
		INSERT INTO tmp_TempTable (SheetName,ParentTable) SELECT @SheetName,@ParentTable;
		END IF;
		SELECT SheetName AS SheetName, ParentTable AS ParentTable, ChildTable AS ChildTable FROM tmp_TempTable;
	
	COMMIT;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
