CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_GetTeamsByAccount`(p_userId INT, p_companyId INT)
BEGIN
 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END; 
  START TRANSACTION;
  
  SELECT U.UserId, UT.TeamId, (SELECT TeamName FROM team WHERE id = UT.TeamId) AS TeamName
  FROM user AS U
  INNER JOIN userteam AS UT ON UT.UserId = U.UserId   
  WHERE U.UserId = p_userId AND U.CompanyId = p_companyId order by TeamId asc;

  
  COMMIT;
END ;;
