CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_GetTemplateByFolderId`(p_FolderId int)
BEGIN
DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;  
	START TRANSACTION;
		SELECT t.TemplateId
			,t.TemplateName
			,t.Description
			,t.IsDemoTemplate
			,count(tf.TemplateFileId) AS PdfCount
		FROM Template t
		LEFT JOIN TemplateFile tf ON t.TemplateId = tf.TemplateId
