CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_Login`(
	 p_UserName VARCHAR(150)
	,p_Password VARCHAR(50)
	,p_AccountName VARCHAR(150)
	)
BEGIN 	

	IF ((SELECT COUNT(CompanyId) FROM Company WHERE AccountName = p_AccountName) > 0)
	THEN
		SELECT @CompanyId := CompanyId
		FROM Company
		WHERE AccountName = p_AccountName;

		SELECT UserId
			,UserType
			,FullName
			,CompanyId
			,(SELECT CompanyName FROM Company WHERE CompanyId = @CompanyId) AS CompanyName
			,UserName
			,Email
			,IsActive
		FROM User
		WHERE Email = p_UserName AND Password = p_PassWord AND CompanyId= @CompanyId AND IsActive = 1;	
	ELSE	
		SELECT @CompanyId := CompanyId
		FROM User
		WHERE Email = p_UserName AND Password = p_PassWord AND IsActive = 1;
        
		SELECT UserId, UserType, FullName, CompanyId,
               (SELECT CompanyName FROM Company WHERE CompanyId = @CompanyId) AS CompanyName
			,UserName
			,Email
			,IsActive
		FROM User
		WHERE Email = p_UserName AND Password = p_PassWord AND CompanyId= @CompanyId AND IsActive = 1;
	END IF;
END ;;
DELIMITER ;
