CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_MapParentTableFields`(
	p_createdByUser VARCHAR(200)	
	)
BEGIN

 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
    DELETE FROM udt_parentfield WHERE createByUser = p_createdByUser;
	ROLLBACK;
	RESIGNAL;
  END;      
	START TRANSACTION;
    

    
			UPDATE TemplateFileFieldMapping AS T
            INNER JOIN udt_parentfield AS S ON T.TemplateFileMappingId = S.TemplateFileMappingId
			SET T.ExcelFieldName = S.ExcelFieldName
				,T.IsMapped = S.IsMapped
				,T.SheetName = S.SheetName
				,T.ExcelTableName = S.ExcelTableName WHERE S.createByUser = p_createdByUser;		
		DELETE FROM udt_parentfield WHERE createByUser = p_createdByUser;
	COMMIT;
END ;;
DELIMITER ;
