CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_RemoveAllMappedFields`(p_TemplateId INT)
BEGIN
DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;  
	START TRANSACTION;	
		UPDATE TemplateFileFieldMapping
		SET IsMapped = 0
			,SheetName = NULL
			,ExcelFieldName = NULL
			,ExcelTableName = NULL
		WHERE TemplateId = p_TemplateId;

		DELETE
		FROM ParentChildMapping
		WHERE TemplateFileId IN (
				SELECT TemplateFileId
				FROM TemplateFileFieldMapping
				WHERE TemplateId = p_TemplateId
				);
	
	COMMIT;
END ;;
