CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_RemoveDynamicFieldMapping`(
	p_TemplateFileMappingId INT
	,p_IsDynamicField BIT
	)
BEGIN

 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;
    
		SELECT @FieldId := FieldId
			,@TemplateFileId := TemplateFileId
			,@ChildTableName := ExcelTableName
		FROM TemplateFileFieldMapping
		WHERE TemplateFileMappingId = p_TemplateFileMappingId;

		IF (p_IsDynamicField = 1)
		THEN
			DELETE FROM ParentChildMapping
			WHERE TemplateFileId = @TemplateFileId
				AND ChildTableName = @ChildTableName;

			UPDATE TemplateFileFieldMapping
			SET IsMapped = 0
				,SheetName = NULL
				,ExcelTableName = NULL
				,ExcelFieldName = NULL			
			WHERE FieldId = @FieldId
				OR ParentFieldId = @FieldId;		
		ELSE		
			SELECT @ParentFieldId := ParentFieldId
			FROM TemplateFileFieldMapping
			WHERE TemplateFileMappingId = p_TemplateFileMappingId;
			UPDATE TemplateFileFieldMapping
			SET IsMapped = 0
				,SheetName = NULL
				,ExcelTableName = NULL
				,ExcelFieldName = NULL				
			WHERE FieldId = @FieldId;
			IF (
					(
						SELECT COUNT(TemplateFileMappingId)
						FROM TemplateFileFieldMapping
						WHERE ParentFieldId = @ParentFieldId
							AND IsMapped = 1 GROUP BY TemplateFileMappingId
						) = 0
					)
			THEN
				DELETE FROM ParentChildMapping
				WHERE TemplateFileId = @TemplateFileId
					AND ChildTableName = @ChildTableName;

				UPDATE TemplateFileFieldMapping
				SET IsMapped = 0
					,SheetName = NULL
					,ExcelTableName = NULL
					,ExcelFieldName = NULL					
				WHERE FieldId = @ParentFieldId;
			END IF;
		END IF;

	COMMIT;
END ;;
DELIMITER ;
