CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_RemoveMappedField`(
	p_TemplateFileMappingId INT
	,p_IsStaticField BIT
	,p_ParentFieldName TEXT
	)
BEGIN


 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;
		UPDATE TemplateFileFieldMapping
		SET IsMapped = 0
			,SheetName = NULL
			,ExcelTableName = NULL
			,ExcelFieldName = NULL
		WHERE TemplateFileMappingId = p_TemplateFileMappingId;

	
			SELECT @TemplateFileId := TemplateFileId
			FROM TemplateFileFieldMapping
			WHERE TemplateFileMappingId = p_TemplateFileMappingId;

			IF (
					(
						SELECT COUNT(TemplateFileMappingId)
						FROM TemplateFileFieldMapping
						WHERE TemplateFileId = @TemplateFileId
							AND IsMapped = 1
							AND HasChildFields = 0 
						) = 0
					)
			THEN
				UPDATE TemplateFileFieldMapping
				SET SheetName = NULL
					,ExcelTableName = NULL
				WHERE TemplateFileId = @TemplateFileId
					AND ParentFieldId IS NULL;
			END IF;
	
	COMMIT;
END ;;
