CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_TemplateFileFieldsMappedPercentage`(
	p_TemplateFileId INT
	,OUT p_Percentage FLOAT
	)
BEGIN

 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;       
	START TRANSACTION;

		SELECT @TotalFields := COUNT(TemplateFileMappingId)
		FROM TemplateFileFieldMapping
		WHERE TemplateFileId = p_TemplateFileId
			AND HasChildFields = 0;

		SELECT @TotalMappedFields := COUNT(TemplateFileMappingId)
		FROM TemplateFileFieldMapping
		WHERE TemplateFileId = p_TemplateFileId
			AND HasChildFields = 0
			AND IsMapped = 1;

		IF (@TotalFields = 0)
		THEN
			SET p_Percentage = 0;		
		ELSE		
			SET p_Percentage = (@TotalMappedFields * 100.00 / @TotalFields);
		END IF;
	
	COMMIT;
END ;;
