CREATE DEFINER=`root`@`localhost` PROCEDURE `usp_UpdateTemplate`(
	 p_DeletedTemplateFileIds varchar(100)
	,p_UpdatedBy int
	,p_Template JSON
	,p_TemplateFile JSON
	,p_TemplateFileFieldMapping JSON
	,p_TemplateFileZip LONGBLOB
	)
BEGIN



DECLARE `Template_items` BIGINT UNSIGNED DEFAULT JSON_LENGTH(`p_Template`);
DECLARE `_index_Template` BIGINT UNSIGNED DEFAULT 0;

 DECLARE `TemplateFIle_items` BIGINT UNSIGNED DEFAULT JSON_LENGTH(`p_TemplateFile`);
 DECLARE `_index_TemplateFIle` BIGINT UNSIGNED DEFAULT 0;
    
 DECLARE `TemplateFileFieldMapping_items` BIGINT UNSIGNED DEFAULT JSON_LENGTH(`p_TemplateFileFieldMapping`);
 DECLARE `_index_TemplateFileFieldMapping` BIGINT UNSIGNED DEFAULT 0;

 DECLARE EXIT HANDLER FOR SQLEXCEPTION 
  BEGIN
	ROLLBACK;
	RESIGNAL;
  END;      
	START TRANSACTION;
    
    DROP TEMPORARY TABLE IF EXISTS `tmp_Template`;
        
	CREATE TEMPORARY TABLE IF NOT EXISTS `tmp_Template` (`TemplateId` INT, `CompanyId` INT, `TeamIdId` INT, `TemplateName` VARCHAR(100), `Description` VARCHAR(500), `IsActive` BIT, `CreatedOn` DATETIME, `CreatedBy` INT, `UpdatedOn` DATETIME, `UpdatedBy` INT, `SubFolderName` TEXT, `FileNamePart` TEXT);
    WHILE `_index_Template` < `Template_items` 
	DO
	  INSERT INTO tmp_Template (`TemplateId`,`CompanyId`,`TeamIdId`,`TemplateName`,`Description`,`IsActive`,`CreatedOn`,`CreatedBy`,`UpdatedOn`,`UpdatedBy`,`SubFolderName`,`FileNamePart`)
      VALUES
           (
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].TemplateId'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].CompanyId'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].TeamIdId'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].TemplateName'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].IsActive'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].CreatedOn'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].CreatedBy'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].UpdatedOn'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].UpdatedBy'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].SubFolderName'),
              JSON_EXTRACT(`p_Template`,'$[`_index_Template`].FileNamePart')
           );
      SET `_index_Template` := `_index_Template` + 1;
    END WHILE;
    
    DROP TEMPORARY TABLE IF EXISTS `tmp_TemplateFile`;
        
